						actionID = -1,
						actionLua = "local start,mid,finish,line = AnyoneCore.convertSettingsToU32()\nlocal startA,midA,finishA = 0,0,0\nlocal tbl = {}\nline = MoogleTelegraphs.Settings.outlineThickness.enemy\ntbl.start = {r=MoogleTelegraphs.Settings.fillRGB.enemy.start.r/255,g=MoogleTelegraphs.Settings.fillRGB.enemy.start.g/255,b=MoogleTelegraphs.Settings.fillRGB.enemy.start.b/255,a=startA}\ntbl.mid = {r=MoogleTelegraphs.Settings.fillRGB.enemy.mid.r/255,g=MoogleTelegraphs.Settings.fillRGB.enemy.mid.g/255,b=MoogleTelegraphs.Settings.fillRGB.enemy.mid.b/255,a=midA}\ntbl.finish = {r=MoogleTelegraphs.Settings.fillRGB.enemy.finish.r/255,g=MoogleTelegraphs.Settings.fillRGB.enemy.finish.g/255,b=MoogleTelegraphs.Settings.fillRGB.enemy.finish.b/255,a=finishA}\nlocal start2,mid2,finish2 = GUI:ColorConvertFloat4ToU32(tbl.start.r,tbl.start.g,tbl.start.b,tbl.start.a),GUI:ColorConvertFloat4ToU32(tbl.mid.r,tbl.mid.g,tbl.mid.b,tbl.mid.a),GUI:ColorConvertFloat4ToU32(tbl.finish.r,tbl.finish.g,tbl.finish.b,tbl.finish.a)\n\n\nif data.drawnAOEs == nil then data.drawnAOEs = {} end\n\nlocal argus = Argus.getCurrentDirectionalAOEs()\nif table.valid(argus) then\n\tfor source,aoe in pairs(argus) do\n\t\tif table.valid(aoe) and not data.drawnAOEs[source] then\n\t\t\tif aoe.aoeID == 9968 then\n\t\t\t\tlocal aoepos = {x = aoe.x, y = aoe.y, z = aoe.z}\n\t\t\t\tfor i=1,6 do\n  \t\t\t\tlocal pos = TensorCore.getPosInDirection(aoepos, aoe.heading, 8*i)\n  \t\t\t\tif i == 1 then\n  \t\t\t\t\t\tArgus2.addTimedCircleFilled(1600, pos.x, pos.y, pos.z, 6 , 50, start, finish, mid, 3700,nil,nil,line)\n\t\t\t\t\t\t\t\tif AnyoneCore.Settings.DrawExaflaresAhead then\n\t\t\t\t\t\t\t\t\t\tArgus2.addTimedCircleFilled(1600*i, pos.x, pos.y, pos.z, 6 , 50, start2, finish2, mid2, 3700,nil,nil,line)\n\t\t\t\t\t\t\t\tend\n  \t\t\t\telse\n    \t\t\t\tArgus2.addTimedCircleFilled(1600, pos.x, pos.y, pos.z, 6 , 50, start, finish, mid, (3700-1575)+(i*1575),nil,nil,line)\n\t\t\t\t\t\t\t\tif AnyoneCore.Settings.DrawExaflaresAhead then\n\t\t\t\t\t\t\t\t\t\tArgus2.addTimedCircleFilled(1600*i, pos.x, pos.y, pos.z, 6 , 50, start2, finish2, mid2, (3700-1575)+(1575),nil,nil,line)\n\t\t\t\t\t\t\t\tend\n  \t\t\t\tend\n\t\t\t\t\t\tdata.drawnAOEs[source] = true\n\t\t\t\tend\n\t\t\tend\n\t\tend\n\tend\nend\nself.used = true",
